import React from 'react';
import './App.css';
import {ImageParallax} from './ImageParallax/ImageParallax'
import {AboutMe} from './AboutMe/aboutme'
import {ImageGallery} from './ImageGallery/ImageGallery'
import {ContectMe} from './Contectme/ContectMe'
import first from './Content/photos/first.jpeg'
import third from './Content/photos/third.jpeg'

const image1 ="https://images.unsplash.com/photo-1498092651296-641e88c3b057?auto=format&fit=crop&w=1778&q=60&ixid=dW5zcGxhc2guY29tOzs7Ozs%3D";

function componentDidMount() {
  fetch('http://localhost:3001/title')
    .then(response => response.json())
    .then(data =>({ 
        return :data
      }));
}

const imageWithTitle =(

  <ImageParallax url = {first} title ={componentDidMount().innerHtml()}/>
);


function App() {  
  return (
    <div className="App">
    {imageWithTitle}
    <AboutMe/>
    <ImageParallax url = {third} title =""/>
    <ImageGallery/>
    <ImageParallax url = {image1} title =""/>
    <ContectMe/>
    </div>
  );
}

export default App;
